import React, { Component } from 'react'

export default class Search extends Component {
    state = {
        keyword : null
    }
    render() {
        return (
            <div>
                <div>
                    <form>
                        <label>Search</label>
                        <input type="text" value={this.state.keyword}></input>
                    </form>
                </div>
            </div>
        )
    }
}
